import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input
    await page.waitForSelector('#searchInput', { timeout: 5000 });

    // Focus and type into the search input to trigger autocomplete
    await page.click('#searchInput');
    await page.type('#searchInput', 'iph');

    // Wait for the search suggestions dropdown to appear
    await page.waitForSelector('#searchSuggestions', { timeout: 5000 });

    // Take screenshot of the autocomplete suggestions
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_autocomplete.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_autocomplete.png'));

    // Extract the suggestion texts
    const suggestionItems = await page.$$eval('#searchSuggestions .suggestion-item', els =>
      els.map(el => el.textContent.trim())
    );

    // Click the first suggestion if available
    if (suggestionItems.length > 0) {
      await page.click('#searchSuggestions .suggestion-item');
      // Wait for the search results to appear (look for "Search Results" heading)
      await page.waitForSelector('text=Search Results', { timeout: 5000 });
      await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));
    }

    return {
      success: true,
      action: "Tested search autocomplete: triggered suggestions, extracted suggestion texts, selected first suggestion, and verified search results.",
      extractedData: {
        suggestions: suggestionItems
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
